import React from "react";

const ItsOverNineThousand = ({ result, setResult }) => {
	const rendering = () => {
		try {
			setResult(eval(result).toString());
		} catch (error) {
			setResult("Error");
		}
	};
	return (
		<div>
			<button onClick={rendering}>Yahou</button>
		</div>
	);
};

export default ItsOverNineThousand;
